import './Card.css'
import PropTypes from 'prop-types'
import NotPlayable from '../NotPlayable'

const Card = ({ card, hideCard }) => {
    return (
        <div className="card">
            {/* {card} */}
            { hideCard ? (
                <div className="not_playable"></div>
            ) : (
                {card}
            )}
        </div>
    )
}

Card.propTypes = {
    card: PropTypes.oneOfType([
        PropTypes.number,
        PropTypes.oneOf([' '])
    ]).isRequired
};

export default Card;
